import React from 'react'
import Card from '../UI/Card'
import style from "./UserList.module.css";
function UserList(props) {
  return (
    <Card classname={style.users}> 
        <ul>
        {
            props.user.map((use)=>{
                <li>{use.name} {user.age}</li>
            })
        }
        </ul>
    </Card>
  )
}

export default UserList
